import React from 'react';
import Link from 'next/link'


const Navigation = () => {
    return(
        <>
            <ul> 
                <li>
                    <Link href='/'><a>Home</a></Link>
                </li>
                <li>
                    <Link href='/character'><a>Personajes</a></Link>
                </li>
            </ul>
                       
            <style jsx>{`
                ul{
                    width: 100%;
                    display: flex;
                    background: yellow;
                }
                li{
                    display: inline-block;
                    margin-left: 3em;
                }
            
            `}</style>
        </>
    )
}
export default Navigation;
